{"id": "_wiki_Ronald_Raymond__New_Earth_", "publisher": "_dc-comics_4010-10_", "name": "Firestorm", "real_name": "Ronald \"Ronnie\" Roy Raymond", "current_alias": "Firestorm", "alignment": "Good", "identity": "Secret Identity", "race": null, "citizenship": "American", "marital_status": "Single", "gender": "Male", "height": "6' 2\" (As Firestorm); 6'1\" (As Raymond)", "weight": "As Raymond", "eyes": "Blue", "hair": "Auburn", "aliases": ["Ronald Roy Rockwell (birth name)"], "relatives": [["_wiki_Richard_Dare__New_Earth_", "adoptive grandfather"], ["_wiki_Edward_Rockwell__New_Earth_", "mother"], ["_wiki_Felicity_Smoak__New_Earth_", "stepmother"]], "affiliations": [["_wiki_Firestorm_Matrix", "Firestorm Matrix"], ["_wiki_Justice_League_of_America__New_Earth_", "Justice League"], ["_wiki_Black_Lantern_Corps__New_Earth_", "Black Lantern Corps"], ["_wiki_White_Lantern_Corps__New_Earth_", "White Lantern Corps"], ["_wiki_Power_Company", "Power Company"]], "operation_bases": [["_wiki_Manhattan", "Manhattan"], ["_wiki_New_York_City", "New York City"], ["_wiki_Ivy_University", "Ivy University"], ["_wiki_Ivy_Town", "Ivy Town"], ["_wiki_Pittsburgh", "Pittsburgh"], ["_wiki_Pennsylvania", "Pennsylvania"]], "occupations": [], "creators": [["_wiki_Gerry_Conway", "Gerry Conway"], ["_wiki_Al_Milgrom", "Al Milgrom"]], "place_of_birth": ["/wiki/New_York_City", "New York City"], "first_appearance": ["/wiki/Firestorm_Vol_1_1", "March, 1978"], "image_url": "https://vignette.wikia.nocookie.net/marvel_dc/images/8/83/Firestorm_Vol_3_21_Textless.jpg/revision/latest?cb=20140710175400", "trivia_facts": ["Ronnie is affectionately known as Flamehead.", "Many of the supporting cast members from Firestorm's comic had alliterative names, such as: Clarissa Clemens, Cliff Carmichael, Doreen Day, Jefferson Jackson, Louise Lincoln, Ronnie Raymond, etc. This is similar to a permutation inherent in the Superman mythos where a large portion of his supporting cast have names with the intitials of double \"L\" (Lex Luthor, Lori Lemaris, Lois Lane, Lana Lang, Lucy Lane, etc.).", "Firestorm had a halo of flame encircling the crown of his head. However, this flame was not composed of true plasma, and was actually just an illusory hologram generated by Ronnie Raymond's subconscious. As such, the halo did not possess the characteristics akin to ordinary fire. It did not generate heat or cause harm to those who came into contact with it. The solidarity of the flame altered from time to time. In some instances, the flame would extinguish itself if Firestorm were rendered unconscious or submerged under water. On other occasions, it would continue to flicker. All future incarnations of Firestorm possessed some variant of the flame halo. The Firestorm Elemental had a flaming crown that trailed halfway down his back, while the modern Firestorm had a holographic projection similar to that used by Ronnie Raymond.", "Firestorm Annual (Volume 2) #3 tried to explain Firestorm's power source, and says that it is the sun. But it also tells us that sunspots are the reason for his inability to multitask with his powers. Stein says that at that particular time, the solar (sunspot) cycle was at a high point but, the Wikipedia page on Sporer's Law (just use the bottom section of the diagram) tells us that during that year (1985) there were practically no sunspots. This could mean a lot of different things: 1, nothing in the New Earth timeline is to be trusted or associated with our timeline or position in orbit. Or, there is 2: Firestorm's powers were not actually explained and Stein's study of Firestorm's powers failed entirely. His real powers may be heightened BY sunspots or not related to solar radiation at all."], "powers": ["Firestorm Matrix", "Density Control", "Eidetic Memory", "Energy Absorption", "Energy Projection", "Enhanced Vision", "Flight", "Molecular Reconstruction", "Phasing", "Psychic Link", "Regeneration", "Self-Sustenance", "Superhuman Durability", "Superhuman Strength", "Transformation"], "abilities": [], "weaknesses": [], "wikipedia_link": "http://en.wikipedia.org/wiki/Firestorm", "prov_url": "http://dc.wikia.com/wiki/Ronald_Raymond_(New_Earth)", "prov_timestamp": "2018-11-23 14:04:13.806069"}
