{"id": "_wiki_Travis_Morgan__New_Earth_", "publisher": "_dc-comics_4010-10_", "name": "Warlord", "real_name": "Travis Morgan", "current_alias": "Warlord", "alignment": "Good", "identity": "Public Identity", "race": null, "citizenship": "American Skartarian", "marital_status": "Married , Widowed", "gender": "Male", "height": "6' 0\"", "weight": "85 kg", "eyes": "Blue", "hair": "White", "aliases": ["Lieutenant Colonel"], "relatives": [["_wiki_Kyle_Morgan__New_Earth_", "first wife"], ["_wiki_Tara_Morgan__New_Earth_", "second wife"], ["_wiki_Jennifer_Morgan__New_Earth_", "daughter"], ["_wiki_Joshua_Morgan__New_Earth_", "son"]], "affiliations": [], "operation_bases": [["_wiki_Skartaris", "Skartaris"]], "occupations": ["USAF Pilot", "Adventurer"], "creators": [["_wiki_Mike_Grell", "Mike Grell"]], "place_of_birth": [null, null], "first_appearance": ["/wiki/1st_Issue_Special_Vol_1_8", "November, 1975"], "image_url": "https://vignette.wikia.nocookie.net/marvel_dc/images/b/b7/Warlord_036.jpg/revision/latest?cb=20090419041759", "trivia_facts": ["Travis Morgan bears a striking resemblance to Oliver Queen, the Green Arrow. During Grell's run on Green Arrow, Travis Morgan shows up in Seattle and the two of them meet.[8] After being attacked on sight by half of the Seattle underworld population (all of whom mistake him for Green Arrow), Morgan shows up at Oliver's house and declares, \"Whatever you've been doing to piss these people off... cut it out!!\" Finally appearing on-panel together, Grell illustrates that while there is an uncanny resemblance, Travis Morgan is significantly taller than Oliver Queen, and seemingly several years older. When Aquaman accidentally passes through a dimensional portal that leads to Skartaris, he meets Travis Morgan and mistakes him for Oliver back from the dead (this was after Oliver had been killed by a terrorist's bomb, and before he was resurrected by Hal Jordan). During Kevin Smith's Green Arrow run, during the \"Quiver\" story arc, Deadman pokes fun at the resemblance as well.[9]"], "powers": [], "abilities": ["Equestrianism", "Firearms", "Hand-to-Hand Combat", "Leadership", "Survival Training", "Swimming", "Swordsmanship", "Tactical Analysis", "Tracking"], "weaknesses": [], "wikipedia_link": "http://en.wikipedia.org/wiki/Warlord_(comics)", "prov_url": "http://dc.wikia.com/wiki/Travis_Morgan_(New_Earth)", "prov_timestamp": "2018-11-23 14:05:06.307373"}
