ers": ["Thermokinesis"], "abilities": [], "weaknesses": [], "wikipedia_link": "http://en.wikipedia.org/wiki/Firehawk", "prov_url": "http://dc.wikia.com/wiki/Lorraine_Reilly_(New_Earth)", "prov_timestamp": "2018-11-23 14:05:33.114693"}
