an would need).", "When Ra's was kept in Arkham Asylum his assumed identity was American, not Egyptian.", "It remains unknown exactly how old Ra's al Ghul is (see Notes above). All that is known is that he has lived well beyond a normal human life span."], "powers": ["Lazarus Enhancement", "Longevity", "Enhanced Strength", "Enhanced Speed", "Enhanced Stamina", "Enhanced Agility", "Enhanced Durability"], "abilities": ["Alchemy", "Genius Level Intellect", "Leadership", "Martial Arts", "Occultism", "Swordsmanship", "Tactical Analysis", "Weaponry"], "weaknesses": [], "wikipedia_link": "http://en.wikipedia.org/wiki/Ra%27s_al_Ghul", "prov_url": "http://dc.wikia.com/wiki/Ra%27s_al_Ghul_(New_Earth)", "prov_timestamp": "2018-11-23 14:06:00.312525"}
