rived on Earth.[135]", "Supergirl once owned a male tabby house cat named Streaky. Streaky was accidentally exposed to X-Kryptonite and gained super-powers for brief periods of time. Although super-powered, Streaky was still prone to typical feline behavior, such as using steel street lamps as scratching posts. He lost his powers during Superman: Kryptonite Nevermore when all Kryptonite on Earth is turned into iron (source).", "Supergirl is also known as the Girl of Steel, the Maid of Might, the Princess of Power, Mighty Maid, the Blonde Blockbuster and the Stanhope Sensation during her college years.", "Supergirl has studied at Stanhope College, the New Athens Experimental School, Vandyre University and Lake Shore University.", "Kara is a football fan.[136]. She also likes old movies,[137] is also passionate about acting,[138] and is a staunch cat person.[139]-[140]", "Kara has a characteristic thinking tic. She often puts a finger to her mouth when she's figuring something out.[141]-[142]-[143]-[144]-[145]. Said quirk is shared by a lot of her counterparts in the Multiverse.[146]-[147]-[148]-[149]", "Batgirl taught Supergirl karate as well as riding bikes.[150]"], "powers": ["Kryptonian Physiology", "Solar Energy Absorption", "Heat Vision", "Super-Hearing", "Enhanced Vision", "Electromagnetic Spectrum Vision", "Telescopic Vision", "X-Ray Vision", "Microscopic Vision", "Infrared Vision", "Flight", "Invulnerability", "Superhuman Stamina", "Superhuman Strength", "Superhuman Speed", "Superhuman Agility", "Superhuman Reflexes", "Super-Breath"], "abilities": ["Acting", "Driving", "Eidetic Memory", "Equestrianism", "Genius Level Intellect", "Hand-to-Hand Combat (Advanced)", "Journalism", "Leadership", "Lock Picking", "Multilingualism", "Photography", "Psychology", "Science", "Electrical Engineering", "Mechanical Engineering", "Robotic Engineering"], "weaknesses": ["Kryptonian Physiology", "Vulnerability to Kryptonite", "Vulnerability to Magic"], "wikipedia_link": "http:/