echno-alchemy.[47]\n When war broke out in Hell, Lilith recalled all the dark powers from Earth. Etrigan was reclaimed from Jason's soul.[54]", "Jason managed to extinguish Etrigan entirely with the Philosopher's Stone using intense magical cold.[15]", "Etrigan was first separated when Merlin was resurrected, but mesmerised into a trap.[53]", "After they were rejoined, Merlin's absence changed their dynamic briefly, and when Jason summoned Etrigan Jason also remained on the physical plane. This stopped after Merlin was free of Asteroth.[28]", "Elphius Levi successfully exorcised Etrigan with techno-alchemy.[47]", "When war broke out in Hell, Lilith recalled all the dark powers from Earth. Etrigan was reclaimed from Jason's soul.[54]"], "powers": ["Immortality", "Magic", "Energy Absorption", "Eldritch Blast", "Telekinesis", "Clairvoyance", "Summoning", "Exorcism", "Magic Wards", "Dimensional Travel", "Advanced Magic", "Razormagick", "Telepathy", "Mind Control", "Precognition"], "abilities": ["Occultism", "Pedagogy", "Meditation", "Multilingualism", "Hand-to-Hand Combat (Advanced)", "Wrestling", "Swordsmanship", "Equestrianism"], "weaknesses": [], "wikipedia_link": "http://en.wikipedia.org/wiki/Jason_Blood", "prov_url": "http://dc.wikia.com/wiki/Jason_Blood_(New_Earth)", "prov_timestamp": "2018-11-23 14:09:41.630075"}
