{"id": "_wiki_Henry_Hall__New_Earth_", "publisher": "_dc-comics_4010-10_", "name": "Hawk", "real_name": "Henry \"Hank\" Hall", "current_alias": "Hawk", "alignment": "Good", "identity": "Secret Identity", "race": null, "citizenship": "American", "marital_status": "Single", "gender": "Male", "height": "6' 1\"", "weight": "89 kg", "eyes": "Red", "hair": "Brown", "aliases": ["Monarch", "Extant"], "relatives": [["_wiki_Donald_Hall__New_Earth_", "brother"], ["_wiki_Irwin_Hall__New_Earth_", "father"], ["_wiki_Rae_Hall__New_Earth_", "mother"], ["_wiki_James_Penfield__New_Earth_?action=edit&redlink=1", "uncle"]], "affiliations": [["_wiki_Hawk_and_Dove", "Hawk and Dove"], ["_wiki_Birds_of_Prey__New_Earth_", "Birds of Prey"], ["_wiki_Black_Lantern_Corps__New_Earth_", "Black Lantern Corps"], ["_wiki_White_Lantern_Corps", "White Lantern Corps"], ["_wiki_Teen_Titans__New_Earth_", "Teen Titans"], ["_wiki_Titans_West", "Titans West"]], "operation_bases": [["_wiki_Washington,_D.C.", "Washington, D.C."]], "occupations": [], "creators": [["_wiki_Steve_Ditko", "Steve Ditko"], ["_wiki_Steve_Skeates", "Steve Skeates"]], "place_of_birth": [null, null], "first_appearance": ["/wiki/Showcase_Vol_1_75", "June, 1968"], "image_url": "https://vignette.wikia.nocookie.net/marvel_dc/images/0/06/Hawk_001.jpg/revision/latest?cb=20090927190413", "trivia_facts": ["Hank did not vote for Barack Obama. [citation needed]", "Hank once went around a number of warehouses to find which was being used as a hideout for some criminals, saying \"Hawk\" outside each, until he changed.", "Hank hates the country band Dixie Chicks, going so far as to break a jukebox just because it was playing a song of theirs.", "Hank was not supposed to be Monarch, originally, Captain Atom was supposed to be Monarch, however, this information was leaked, and to try and retain the surprise, it was changed to Hawk at the last minute. This was met with heavy critism from fans (Mainly due to most of the facts pointing towards Atom being Monarch.)", "Hawk is an agent of Chaos, he's named Hawk because the hawk is a symbol of war, glory and power used by many countries, kingdoms and empires like the Roman Empire, the German army in the two World Wars and some others at different points of history.", "It is heavily implied that Hank and Bette Kane had a sexual fling during their time together in Titans West."], "powers": ["Danger Sense Transformation", "Claws", "Hypervigilant", "Superhuman Durability", "Superhuman Agility", "Superhuman Reflexes", "Superhuman Stamina", "Superhuman Strength"], "abilities": ["Hand-to-Hand Combat (Advanced)", "Firearms", "Military Protocol"], "weaknesses": ["Vulnerability to lack of injustice"], "wikipedia_link": "http://en.wikipedia.org/wiki/Hawk_and_Dove", "prov_url": "http://dc.wikia.com/wiki/Henry_Hall_(New_Earth)", "prov_timestamp": "2018-11-23 14:10:20.258529"}
