{"id": "_wiki_Guy_Gardner__New_Earth_", "publisher": "_dc-comics_4010-10_", "name": "Green Lantern", "real_name": "Guy Darrin Gardner", "current_alias": "Green Lantern", "alignment": "Good", "identity": "Public Identity", "race": "Human/Alien Hybrid \u00b7 Vuldarian", "citizenship": "American", "marital_status": "Single", "gender": "Male", "height": "6' 0\" [1]", "weight": "82 kg", "eyes": "Blue", "hair": "Red", "aliases": ["Guy Joseph Gardner", "Warrior", "The Gardner", "Green Lantern 2814.2", "Red Lantern"], "relatives": [["_wiki_Mace_Gardner__New_Earth_", "brother"], ["_wiki_Roland_Gardner__New_Earth_", "father"], ["_wiki_Peggy_Gardner__New_Earth_", "mother"], ["_wiki_Joseph_Gardner__New_Earth_", "clone"]], "affiliations": [["_wiki_Green_Lantern_Corps__New_Earth_", "Green Lantern Corps"], ["_wiki_Justice_League_International__New_Earth_", "Justice League International"], ["_wiki_Red_Lantern_Corps__New_Earth_", "Red Lantern Corps"], ["_wiki_Star_Sapphire_Corps__New_Earth_", "Star Sapphire Corps"]], "operation_bases": [["_wiki_Oa", "Oa"], ["_wiki_Baltimore", "Baltimore"], ["_wiki_Maryland", "Maryland"], ["_wiki_New_York_City", "New York City"]], "occupations": ["Green Lantern Honor Guard", "formerly Social Worker", "Special Education Teacher", "Bar Owner"], "creators": [["_wiki_John_Broome", "John Broome"], ["_wiki_Gil_Kane", "Gil Kane"]], "place_of_birth": ["/wiki/Baltimore", "Baltimore, Maryland"], "first_appearance": ["/wiki/Green_Lantern_Vol_2_59", "March, 1968"], "image_url": "https://vignette.wikia.nocookie.net/marvel_dc/images/c/cf/Guy_Gardner_004.jpg/revision/latest?cb=20090804144141", "trivia_facts": ["Artist Gil Kane patterned Guy's appearance on actor Martin Milner.", "The character was not named after the NASA astronaut Guy Gardner, but after fan Guy H. Lillian III and writer Gardner Fox.", "Guy is the only person shown to have twice worn the Red Ring and lived after removing it: first with the help of Mogo, who used leeches to remove the corrupted blood in his system caused by the ring, then with the help of Kyle Rayner, who at the time was wearing a Blue Ring, using its power to nullify the effects of the Red Ring, allowing Guy to remove it.", "Guy has worn multiple rings at the same time, wearing his Green Ring and a Red one (against his will) during Blackest Night, then back to Green later. He then wore Red alone in the War of the Green Lanterns, then donning a Violet Ring at the same time before he removed both and went back to Green soon after.", "Guy is also one of the few, if not only man to wear a Violet Ring, though he was not technically accepted or given the right to wear it."], "powers": ["Hybrid Physiology", "Transformation", "Metamorphosis", "Organic Construct Creation", "Size Alteration", "Self-Sustenance", "Superhuman Strength", "Superhuman Speed", "Superhuman Agility", "Superhuman Reflexes", "Superhuman Stamina", "Invulnerability", "Energy Absorption", "Energy Projection", "Adaptation:", "Flight", "Accelerated Healing"], "abilities": ["Indomitable Will", "Green Lantern Ring Mastery"], "weaknesses": [], "wikipedia_link": "http://en.wikipedia.org/wiki/Guy_Gardner_(comics)", "prov_url": "http://dc.wikia.com/wiki/Guy_Gardner_(New_Earth)", "prov_timestamp": "2018-11-23 14:10:37.845966"}
