Air Force"]], "operation_bases": [["_wiki_Oa", "Oa"], ["_wiki_Edwards_Air_Force_Base", "Edwards Air Force Base"], ["_wiki_Coast_City", "Coast City"], ["_wiki_Oa", "Oa"]], "occupations": ["Green Lantern", "Adventurer", "former Air Force Test Pilot"], "creators": [["_wiki_John_Broome", "John Broome"], ["_wiki_Gil_Kane", "Gil Kane"]], "place_of_birth": ["/wiki/Coast_City", "Coast City, California"], "first_appearance": ["/wiki/Showcase_Vol_1_22", "October, 1959"], "image_url": "https://vignette.wikia.nocookie.net/marvel_dc/images/0/09/Hal_Jordan_024.jpg/revision/latest?cb=20130718162147", "trivia_facts": ["Hal's old address prior to getting his GL Ring was 22 Sea View, Coast City, California.", "Hal Jordan was developed after an initial concept by editor Julius Schwartz and loosely modeled after actor Paul Newman, who was then neighbor of Green Lantern artist Gil Kane.[18]", "Peter David wrote Hal Jordan into a Marvel Comics issue. He is seen in a psychiatric hospital shortly after Zero Hour as a mental patient, with the events of that story taking place inside his mind.[19]", "In Prime Earth continuity it is stated that Hal was raised in a household with two religions. His father is Catholic and his mother is Jewish.[20]", "Hal was able to fly a plane construct so fast that he nearly entered the Speed Force.[21]"], "powers": [], "abilities": ["Green Lantern Ring Mastery", "Indomitable Will", "Boxing", "Aviation", "Leadership"], "weaknesses": [], "wikipedia_link": "http://en.wikipedia.org/wiki/Hal_Jordan", "prov_url": "http://dc.wikia.com/wiki/Green_Lantern_(Hal_Jordan)", "prov_timestamp": "2018-11-23 14:10:43.632055"}
{"id": "_wiki_Green_Arrow__Oliver_Queen_", "publisher": "_dc-comics_4010-10_", "name": "Green Arrow", "real_name": "Oliver Jonas \"Ollie\" Queen", "current_alias": "Green Arrow", "alignment": "Good", "identity": "Secret Identity", "race": null, "citizenship": "American", "marital_status": "Divorced", "gender": "Male", "height": "5' 11\"", "weight": "88 kg", "eyes": "Blue", "hair": "Blond", "aliases": ["Chief Magic Bow[1]"], "relatives": [["_wiki_Robert_Henry_Queen__New_Earth_", "father"], ["_wiki_Moira_Queen__New_Earth_", "mother"], ["_wiki_Dinah_Laurel_Lance__New_Earth_", "ex-wife"], ["_wiki_Connor_Hawke__New_Earth_", "son"], ["_wiki_Robert_Queen__New_Earth_", "son"], ["_wiki_Roy_Harper__New_Earth_", "adopted son"], ["_wiki_Lian_Harper__New_Earth_", "granddaughter"], ["_wiki_Oli-3_Queen__Pre-Zero_Hour_", "descendant"]], "affiliations": [["_wiki_Justice_League_of_America", "Justice League"], ["_wiki_Team_Arrow", "Team Arrow"], ["_wiki_Queen_Industries", "Queen Industries"], ["_wiki_National_Security_Agency", "N.S.A."], ["_wiki_Black_Lantern_Corps", "Black Lantern Corps"], ["_wiki_White_Lantern_Corps", "White Lantern Corps"], ["_wiki_Outsiders__New_Earth_", "Outsiders"], ["_wiki_Justice_League_Elite", "Justice League Elite"]], "operation_bases": [["_wiki_Star_City", "Star City"], ["_wiki_Seattle", "Seattle"]], "occupations": ["Former Businessman", "Reporter"], "creators": [["_wiki_Mort_Weisinger", "Mort Weisinger"], ["_wiki_George_Papp", "George Papp"]], "place_of_birth": [null, null], "first_appearance": ["/wiki/Adventure_Comics_Vol_1_250", "July, 1958"], "image_url": "https://vignette.wikia.nocookie.net/marvel_dc/images/b/bf/Green_Arrow_0012.jpg/revision/latest?cb=20100803064333", "trivia_facts": ["Nicknames for Green Arrow include Emerald Archer, Ace Archer and the Battling Bowman.", "There is a running gag that Green Arrow bears a strong physical resemblance to Warlord, another character illustrated by Mike Grell. The two men actually team up when Warlord arrives in Seattle, and half the criminal population try to murder him under mistaken identity.[94] Aquaman mistakes Warlord for Oliver when he travels to the mythical land of Skartaris.[95] Deadman also makes fun of this during Quiver.[96]", "Oliver Queen's death in the plane explosion is a reference to the Green Arrow of Earth-31.[47] Batman: The Dark Knight Returns features an older version of Oliver who bears a grudge against Superman for an unspecified incident in which his arm was ripped off.[97]", "Oliver Queen's powers, if any, remain unknown. It has been rumoured that Green Arrow may in fact be a metahuman. The Department of Extranormal Operations has a classified dossier on Queen, wherein they indicate such a possibility, but as of yet, this information has not been confirmed nor denied.[2]", "Ollie has a rare Rh-negative blood type, the same as his former lover, Black Canary.[20]", "Ollie's left arm can sometimes cause him pain due to an old injury. He once took an arrow to his left side, chipping his bone which never healed properly.[98][99]"], "powers": [], "abilities": ["Acrobatics", "Archery", "Aviation", "Cooking", "Firearms", "Hunting", "Martial Arts", "Eskrima", "Judo", "Kickboxing", "Karate", "Peak Human Condition", "Politics", "Stick Fighting", "Survival", "Swordsmanship", "Throwing", "Weaponry"], "weaknesses": [], "wikipedia_link": "http://en.wikipedia.org/wiki/Green_Arrow", "prov_url": "http://dc.wikia.com/wiki/Green_Arrow_(Oliver_Queen)", "prov_timestamp": "2018-11-23 14:10:43.902693"}
