{"id": "_wiki_Frederick_DeLamb__New_Earth_", "publisher": "_dc-comics_4010-10_", "name": "Baron Bedlam", "real_name": "Frederick DeLamb", "current_alias": "Baron Bedlam", "alignment": "Bad", "identity": "Secret Identity", "race": null, "citizenship": "Markovian", "marital_status": null, "gender": "Male", "height": "6' 6\"", "weight": "102 kg", "eyes": "Brown", "hair": "Auburn with white highlights", "aliases": [], "relatives": [], "affiliations": [["_wiki_Nazi_Party", "Nazi Party"]], "operation_bases": [["_wiki_Markovia", "Markovia"]], "occupations": ["Former Monarch of Markovia"], "creators": [["_wiki_Mike_W._Barr", "Mike W. Barr"], ["_wiki_Jim_Aparo", "Jim Aparo"]], "place_of_birth": ["/wiki/Markovia", "Markovia"], "first_appearance": ["/wiki/Batman_and_the_Outsiders_Vol_1_1", "August, 1983"], "image_url": "https://vignette.wikia.nocookie.net/marvel_dc/images/d/d9/Baron_Bedlam_0001.jpg/revision/latest?cb=20100211045858", "trivia_facts": ["Baron Bedlam appears out of continuity in a two-page story \"Your Butcher Life!\" published in Outsiders #22. This story is a homage to horror comic-books published by EC and a Bedlam look-alike appears as unsympathetic butcher Mr. Costmeyer, who murders an inspector only to face a fatal destiny soon afterward. Dr. Helga Jace appears as the narrator.", "Bedlam's entry in Who's Who: The Definitive Directory of the DC Universe #2 mentions that his mother is dead, but never explains how or when it happened. The text also mentions that he intended a coup to \"restore\" himself to the Markovian throne, although he never held the throne himself - it was his father. It also explains that King Gregor ascended to the throne after crushing Bedlam's rebellion, which is inexact in the comic - Gregor is clearly a king during the battle against Bedlam's troops.", "Who's Who says that DeLamb made fortune through unknown means; Adventures of the Outsiders #34, published later, explains about his chemical company."], "powers": ["Gravity Manipulation"], "abilities": ["Hand-to-Hand Combat (Basic)", "Tactical Analysis"], "weaknesses": [], "wikipedia_link": "http://en.wikipedia.org/wiki/Baron_Bedlam", "prov_url": "http://dc.wikia.com/wiki/Frederick_DeLamb_(New_Earth)", "prov_timestamp": "2018-11-23 14:11:12.346930"}
