{"id": "_wiki_Franklin_Rock__New_Earth_", "publisher": "_dc-comics_4010-10_", "name": "Sgt. Rock", "real_name": "Franklin Rock", "current_alias": "Sgt. Rock", "alignment": "Good", "identity": "Public Identity", "race": null, "citizenship": "American", "marital_status": "Single", "gender": "Male", "height": "6' 0\"", "weight": "83 kg", "eyes": "Blue", "hair": "Auburn", "aliases": ["General Rock", "Sheriff[1]"], "relatives": [["_wiki_Lawrence_Rock__New_Earth_", "sister"]], "affiliations": [["_wiki_Easy_Company", "Easy Company"], ["_wiki_Task_Force_X", "Task Force X"], ["#cite_note-1", "[2]"]], "operation_bases": [], "occupations": ["Politician", "Soldier", "Sergeant", "General"], "creators": [["_wiki_Robert_Kanigher", "Robert Kanigher"], ["_wiki_Joe_Kubert", "Joe Kubert"]], "place_of_birth": ["/wiki/Pittsburgh", "Pittsburgh, Pennsylvania"], "first_appearance": ["/wiki/Our_Army_at_War_Vol_1_81", "April, 1959"], "image_url": "https://vignette.wikia.nocookie.net/marvel_dc/images/c/c2/Sgt_Rock_01.jpg/revision/latest?cb=20080831051838", "trivia_facts": ["Sgt. Rock's dog tag number during World War II was 409966. This was also the serial number of Air Force Major Nick Hunter. Allegedly, the number 409966 was writer Robert Kanigher's own dogtag number during the time he spent in the service.[9]", "Robert Kanigher mused in letters columns in the 1970s and 1980s that Rock probably belonged to \"The Big Red One\" (1st Infantry Division) given his appearance on battlefields in North Africa, Italy and Northwest Europe. The backstory for Rock was fleshed out in different comics over the years; generally he is considered to have come from Pittsburgh, Pennsylvania where he worked in a steel mill. Enlisting after the attack on Pearl Harbor, he went to North Africa as a private but promotion came quickly as his superiors were killed, to assistant squad leader, squad leader, and then platoon sergeant. During the main series, his unit is only ever given as \"Easy Company\", but no regiment or division is named nor is unit insignia ever shown. In the 2009 six-issue mini-series, \"Sgt. Rock: The Lost Battalion\", Rock's unit is still referred to as \"Easy Company\", but is of the 141st Infantry Regiment. It is likely Rock's official position in Easy Company was of senior platoon sergeant though dialogue and scripts are usually vague on his actual responsibilities and duties. He usually leads patrols and appears to have powers of command over the men of the company. Several officer characters also appeared in the comic, as both platoon and company commanders, all of whom were regarded by Rock as superiors. Easy's commander was usually referred to as \"the skipper\" by Rock. Rock in turn was referred to by others as the \"topkick\", or senior non-commissioned officer in the company. Most infantry companies did not have Master Sergeants; significantly, Rock does not have the diamond of a First Sergeant on his rank insignia. Rock also usually wears the chevrons and rockers of a Master Sergeant on his uniform and also applied, oversize, to the front of his helmet.", "Frank Rock graduated from Hill Side High School in Pennsylvania.", "Sgt. Rock was awarded the Distinguished Service Cross at Normandy.[10]", "Sgt. Rock is also known as Sgt. Rocky, Service Number 409966, General of Sergeants, Private Rock and Rock of Easy."], "powers": [], "abilities": ["Firearms", "Hand-to-Hand Combat (Advanced)", "Leadership"], "weaknesses": [], "wikipedia_link": "http://en.wikipedia.org/wiki/Sgt._Rock", "prov_url": "http://dc.wikia.com/wiki/Franklin_Rock_(New_Earth)", "prov_timestamp": "2018-11-23 14:11:13.012022"}
