y takes on the mantle of Starman in order to thwart Professor Milo, who had hypnotized him into a terrible phobia of bats.[493] This 'Starman of 1951' was later retconned (post Crisis on Infinite Earths) to have been Charles McNider rather than Bruce. [494]", "Bruce Wayne was named after his father's cousin, Bruce N. Wayne.[495]", "Who's Who: The Definitive Directory of the DC Universe #2 only lists four of Earth-One Batman's relatives: Thomas Wayne, Sr. (father), Martha Wayne (mother), Philip Wayne (uncle) and Elwood Wayne (\"uncle\")", "Bruce Wayne collects ancient coins.[496]", "On the 1976 DC Comics Calendar, his birthday was listed as February 19th."], "powers": [], "abilities": ["Acting", "Artistry", "Aviation", "Business Management", "Criminology"], "weaknesses": [], "wikipedia_link": "http://en.wikipedia.org/wiki/Batman", "prov_url": "http://dc.wikia.com/wiki/Bruce_Wayne_(Earth-One)", "prov_timestamp": "2018-11-23 14:12:43.283731"}
