{"id": "_wiki_Clifford_Steele__New_Earth_", "publisher": "_dc-comics_4010-10_", "name": "Robotman", "real_name": "Clifford \"Cliff\" Steele", "current_alias": "Robotman", "alignment": null, "identity": "Public Identity", "race": null, "citizenship": "American", "marital_status": "Single", "gender": "Male", "height": "6' 2\"", "weight": "134 kg", "eyes": "Photocellular", "hair": "No Hair", "aliases": ["Automaton"], "relatives": [], "affiliations": [["_wiki_Doom_Patrol__New_Earth_", "Doom Patrol"]], "operation_bases": [["_wiki_Doom_Patrol_Headquarters", "Doom Patrol Headquarters"], ["_wiki_Midway_City", "Midway City"], ["_wiki_Michigan", "Michigan"], ["_wiki_Las_Vegas", "Las Vegas"]], "occupations": ["Adventurer", "former International Sports Champion", "International Race Car Driver"], "creators": [["_wiki_Arnold_Drake", "Arnold Drake"], ["_wiki_Bob_Haney", "Bob Haney"], ["_wiki_Bruno_Premiani", "Bruno Premiani"]], "place_of_birth": ["/wiki/Brooklyn", "Brooklyn, New York"], "first_appearance": ["/wiki/My_Greatest_Adventure_Vol_1_80", "June, 1963"], "image_url": "https://vignette.wikia.nocookie.net/marvel_dc/images/4/4d/Doom_Patrol_Vol_5_21_Textless_Cover.jpg/revision/latest?cb=20151223185809", "trivia_facts": ["Robotman's original body was invented by Doctor Niles Caulder who constructed it using a special ceramic polymer metal of his own design. Robotman later used an alternate body created by Doctor Will Magnus of the Metal Men. Cliff assumed this form for a brief period of time before reverting to a body more in line with his original design. In later years, the Lexcorp conglomerate began manufacturing cybernetic components that Cliff used as spare parts.", "According to the timeline provided in Zero Hour  #0, the Doom Patrol were one of the earliest super-hero teams active during the Silver Age era of comics. JLA: Year One  #6 shows the Doom Patrol as experienced heroes working alongside the neophyte Justice League of America.", "Steele had a collection of rare Dixieland recordings.[10]", "In Pre-Crisis continuity, claims to have won the pole-vault for alma matter Dartmouth in 1961.[10]"], "powers": ["Cybernetic Enhancement", "Adhesion", "Superhuman Durability", "Superhuman Stamina", "Superhuman Strength", "Thermokinesis"], "abilities": ["Acrobatics", "Driving", "Hand-to-Hand Combat (Basic)", "Swimming", "Throwing"], "weaknesses": [], "wikipedia_link": "http://en.wikipedia.org/wiki/Robotman_(DC_Comics)", "prov_url": "http://dc.wikia.com/wiki/Clifford_Steele_(New_Earth)", "prov_timestamp": "2018-11-23 14:13:44.898363"}
